import React from 'react'
import './App.css';
import CDECard from './components/CDE';
import CDECard2 from './components/CDE2';
import CDECard3 from './components/CDE3';
import CDECard4 from './components/CDE4';
import CSVReader from 'react-csv-reader'
import jsonObject from './JSON/CDEContent.json'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>{Object.keys(jsonObject)[0]}</h1>
        <div id="versions">
            <p className="version">1.0</p>
            <p className="version">2.0</p>
            <p className="version">3.0</p>
            <p className="version">4.0</p>
        </div>
        <CSVReader onFileLoaded={(data, fileInfo) => console.dir(data, fileInfo)} />
        <br/>

        {callCreateLabel}

      </header>
    </div>
  );
}

function callCreateLabel() {
    var labelAmount = Object.keys(jsonObject.SetData).length;
    for (var i = 0; i < labelAmount; i++) {
        var CDEAmount = Object.keys(jsonObject.SetData)[i].length;
        createLabel(Object.keys(jsonObject.SetData)[i], CDEAmount)
    }
}

function createLabel(labelName: string, CDEAmount : number) {
    return (
      <section className="labelCard"> 
            <h1>Label: {labelName}</h1>
            <div className="CDEs">
                {createCDEs}
            </div>
      </section>
    )
}

function createCDEs(CDEAmount : number) {
    for (var i = 0; i < CDEAmount; i++) {
        <CDECard></CDECard>
    }
}

export default App;
